import React from 'react'
import './Home.css'
import Carousel from '../../Components/Carousel/Carousel';
import Navbar from '../../Components/Navbar/Navbar';


const Home = () => {

  return (
    <main>
      <Navbar />
      <div className='container-home'>
        <div className='main-containter p-20'> 
          <h1 className='mt-10 font-radiocanada font-extrabold text-5xl max-w-480 '>
            The super fast book finder!
          </h1>
        </div>
      </div>
    </main>

  )
}

export default Home
